import { useState, useEffect } from "react";

const Boutique = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/productos/")
      .then((respuesta) => respuesta.json())
      .then(data);
  }, []);

  return "boutique";
};

export default Boutique;
